[c-prescribedprogram_prescribedprogram].btnCCE button[title]:hover::after,
[c-productdetailsdisplay_productdetailsdisplay].btnCCE button[title]:hover::after{
  content: attr(title);
  position: absolute;
  top: -100%;
  left: 0;
  Background: #032d60;
  Color: #fff;
  font-weight: normal; 
  Font-size: 11px;
  border-radius: 4px;
  font-family: sans-serif;
  padding: 0.5rem 1rem;
}

[c-prescribedprogram_prescribedprogram].btnCCE button[title]:hover::before,
[c-productdetailsdisplay_productdetailsdisplay].btnCCE button[title]:hover::before
{
  content: '';
  width: 0;
  height: 0;
  border-left: 20px solid transparent;
  border-right: 20px solid transparent;
  border-top: 20px solid #032d60;
  position: absolute;
  left: 6px;
  top: -14px;
}

