    line-height: 21px;
}

.salesforceIdentityLoginForm2 .inputContainer,
.salesforceIdentityForgotPassword2 .inputContainer{
    margin-bottom: 25px !important;
    padding: 12px;
    background-color: #ffffff;
    border: 1px solid #0066B9 !important;
