}

.iflex{display: inline-block; width: 100%;}

#sfdc_password_container{
    position:relative;
    margin-top: 3rem;
}

#sfdc_password_container::before {
    content: 'Password';
    position: absolute;
    top: -25px;
    left: 0px;
    font-family: "ProximaNova-Bold";
    font-size: var(--text-size-18);
    line-height: 1.3125rem;
    font-style: var(--text-normal);
    font-weight: var(--text-weight-700);
}

.salesforceIdentityLoginBody2{
    display: block !important;
}
.salesforceIdentityLoginForm2 .error {
    margin-top: -80px !important;
    margin-bottom: 30px !important;
    text-align: center;
    color: #C7026F !important;
   font-family: "ProximaNova-Bold";
    font-size: 16px;
    line-height: 1.3125rem;
    height: 50px;
    display: flex;
    justify-content: center;
    align-content: center;
    align-items: center;
    margin: auto;
}

.salesforceIdentityForgotPassword2 .error {
   color: #C7026F !important;
